(function(){var n;n=angular.module("codefist");n.factory("botService",["$http","urls",function(n,t){return{queryByGame:function(i){return n.get(t.botsByGame(i))},queryByUser:function(i){return n.get(t.botsByUser(i))},create:function(i,r){return n.post(t.botsByGame(i),JSON.stringify(r))},get:function(i,r){return n.get(t.bot(i,r))},"delete":function(i,r){return n["delete"](t.bot(i,r))},update:function(i){return n.put(t.bot(i.gameId,i.botId),i)}}}])}).call(this)